import './SearchBar.css';

export default  class SearchBar extends Component {
    state = {
        val: '',
    }
    render() {
        return(
            <div>
                <form className="flexContainer">
                    <label><h2>Image Search: </h2></label>
                    <input className="inputStyle" type="text" />
                </form>
            </div>
        )
    }
};
